import React, { Component } from 'react';
import './AboutPage.css';

class AboutPage extends Component {
    render() {

        return (
            <div className ="about_style">
                <p>We currently have over 200,000 unique baseball cards, last names A-C</p>
                <p>Create an account to add your pulls to your collection</p>
            </div>
        );
    }
};

export default AboutPage;
